const FilterTemperament = () => {

    const dispatch = useDispatch();
  const allTemperament = useSelector((state) => state.filteredTemperament);

  useEffect(() => {
    dispatch(getTemperament());
  }, [dispatch]);

    return(
        <select>
            <option value=""></option>
        </select>
    )
}

export default FilterTemperament;
